// src/pages/Catalog.js
import React from 'react';
import './Catalog.css';

// Importando imágenes locales
import sembradoEcológicoImg from '../assets/sembrado-ecologico.jpg';
import riegoAutomáticoImg from '../assets/riego-automatico.jpg';
import cuidadoMedioAmbienteImg from '../assets/cuidado-medio-ambiente.jpg';
import procesamientoResiduosImg from '../assets/procesamiento-residuos.jpg';

// Datos de los servicios
const services = [
  { 
    title: 'Sembrado Ecológico', 
    description: 'Descripción del servicio de sembrado ecológico, que promueve el uso de métodos sostenibles para cultivar plantas y árboles.', 
    image: sembradoEcológicoImg 
  },
  { 
    title: 'Riego Automático', 
    description: 'Descripción del servicio de riego automático que asegura el riego eficiente de las plantas a través de sistemas automatizados.', 
    image: riegoAutomáticoImg 
  },
  { 
    title: 'Cuidado del Medio Ambiente', 
    description: 'Descripción del servicio de cuidado del medio ambiente, promoviendo prácticas verdes para reducir el impacto ambiental.', 
    image: cuidadoMedioAmbienteImg 
  },
  { 
    title: 'Procesamiento de Residuos', 
    description: 'Descripción del servicio de procesamiento de residuos biológicos para convertirlos en compost o energía renovable.', 
    image: procesamientoResiduosImg 
  }
];

function Catalog() {
  return (
    <div className="catalog">
      <h1>Catálogo de Servicios</h1>
      <div className="service-list">
        {services.map((service, index) => (
          <div key={index} className="service-item">
            <img src={service.image} alt={service.title} className="service-image" />
            <h2>{service.title}</h2>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Catalog;
